description:
The player draws cards to an initial two card hand with the object of bringing the total hand value as close as possible to 21 without exceeding it.

------------------------------------------------------------------------

Install Note
**************
1. Open the Visual RPG Studio folder you just downloaded.
2. Run dotNetFx40_Full_setup to install Microsoft .net 4
3. Run dxwebsetup and install DirectX 9.0c even if you have DirectX 10 installed.
4. Run xnafx40_redist to install Microsoft XNA 4. Also make sure you uninstall older version of XNA.
5. Run Visual RPG Studio. 


